INSERT INTO `stadtraetInnen` (`id`, `gewaehlt_am`, `bio`, `web`, `name`, `twitter`, `facebook`, `abgeordnetenwatch`) VALUES
(1, '1996-03-10', 'Jahrgang 1939, seit 1964 in M√ºnchen, verh., zwei Kinder, r√∂m.kath., Studium Mathematik und Physik, Promotion an der TU M√ºnchen im Fach Physik, Physiker bei der GSF, Gymnasiallehrer.\n17 Jahre im BA ehrenamtlich t√§tig, von 1978 bis 1984 BA-Vorsitzender. \nMitglied im Bau-, Gesundheits-, Kinder- und Jugendhilfe-, Sozial- und Umweltausschuss.\nSeniorenbeauftragter der Fraktion.\n\nSchwerpunkte:\n- Bezahlbaren Wohnraum schaffen, \n- die Ausbildung und Erziehung Jugendlicher wertorientiert f√∂rdern,\n- gegen Gewalt und Drogenmissbrauch an Schulen, \n- gegen Benachteiligung √§lterer Menschen,\n- den Individualverkehr besser leiten und lenken und notwendige Parkm√∂glichkeiten schaffen, auch mit Tiefgaragen, \n- f√ºr gesunde Ern√§hrung und artgerechte Tierhaltung. \n', 'http://www.dr-babor.de/', 'Dr. Babor, Reinhold', NULL, NULL, 'http://www.abgeordnetenwatch.de/dr_reinhold_babor-860-47164.html'),
(2, '1996-03-10', 'Geboren am 1. Juni 1960 in M√ºnchen, verheiratet, ein Sohn, eine Tochter. Selbst√§ndig. Mitglied im Stadtplanungs-, Finanz- und Gesundheitsausschu√ü. ', '', 'Bauernschuster, Ingrid', NULL, NULL, NULL),
(3, '1996-03-10', '&nbsp;', 'http://robert-brannekaemper.de/', 'Brannek√§mper, Robert', NULL, 'RobertBrannekaemper', 'http://www.abgeordnetenwatch.de/robert_brannekaemper-860-47183.html'),
(4, '1996-03-10', 'Geboren am 22. April 1940 in M√ºnchen, rk., Studium Mathematik/Physik an der TU M√ºnchen, Studienr√§tin und Konrektorin an st√§dtischen und staatlichen Realschulen in M√ºnchen, Rektorin in der Schulverwaltung, Schulleiterin, seit 2004 Schulrektorin i.R. 1990¬ñ1994 Mitglied des Bezirkstags von Oberbayern.\nSeit 1996 Schulpolitische Sprecherin der CSU-Fraktion, Korreferentin des\nSchulreferats.\n\nSchwerpunkte:\n¬ï Schul- und Bildungspolitik,\n¬ï Ausbau und Weiterentwicklung der Bildungs- und Sportangebote in M√ºnchen,\n¬ï B√ºrgern√§he in Politik und Verwaltung,\n¬ï Personalpolitik und solide Finanzpolitik, wirtschaftsfreundliche Politik,\n¬ï F√∂rderung bayerischer Tradition.', '', 'Brunner, Marianne', NULL, NULL, NULL),
(5, '1996-03-10', 'Geboren am 7.2.1955 in M√ºnchen. Gymnasiallehrerin. Seit 1994 Mitglied des Stadtrats.\nKinder- und Jugendpolitische, schulpolitische und stv. kulturpolitische Sprecherin. Mitglied im Sportausschuss, Mitglied im Aufsichtsrat Gasteig und im Aufsichtsrat Tierpark.\n\nSchwerpunkte meiner Stadtratst√§tigkeit:\n- Der Ausbau und die Weiterentwicklung der st√§dtischen Bildungsangebote.\n- Die F√∂rderung der kulturellen Bildung.\n- Eine bessere Zusammenarbeit von Schule und Vereinen.\n- Die F√∂rderung des Breitensports.\n- Die F√∂rderung von Vereinen und Initiativen im Stadtteil zum Erhalt der individuellen Stadtteilkultur.\n\nDas Bewahren von Tradition und das Zulassen von Visionen ergeben ein f√ºr M√ºnchen stimmiges Gesamtbild.', '', 'Burkhardt, Beatrix', NULL, NULL, 'http://www.abgeordnetenwatch.de/beatrix_burkhardt-860-47165.html'),
