(66, '1990-03-18', 'Geboren am 26. September 1947 in Innsbruck, zwei T√∂chter, seit 1959 in M√ºnchen. Abitur, Diplom der TU M√ºnchen, Fachrichtung Architektur, ab 1979 freiberuflicher Architekt. Seit 1990 im Stadtrat. Mitglied im Stadtplanungs-, Kultur- und Riemausschu√ü und in der Kommission f√ºr Stadtgestaltung. Politische Schwerpunkte: √ñkologische Stadtentwicklung, Stadtgestalt, Ausbau der √∂ffentlichen Verkehrsmittel, Erhalt bezahlbarer Mietwohnung, F√∂rderung neuer Wohnmodelle und Wohnformen, Unterst√ºtzung experimenteller Kunst. ', '', 'Steyrer, Helmut', NULL, NULL, NULL),
(67, '1978-03-05', 'Geboren am 18. Dezember 1939 in Heinsberg im Rheinland. Selbst√§ndige Kauffrau. Verheiratet, zwei erwachsene S√∂hne. Seit 1978 im Stadtrat. Mitglied im Riem-, Stadtplanungs- und Bauordnungs-, Gesundheits- und Krankenhaus-, Kommunal-, Finanz-, Verwaltungs- und Personalausschu√ü. Mein kommunalpolitisches Handeln ist geleitet von dem Ausspruch von Theodor Heuss:  Die Gemeinde ist wichtiger als der Staat - und das Wichtigste in der Gemeinde sind die B√ºrger.  ', '', 'Kaspar, Heidrun', NULL, NULL, NULL),
(68, '1990-03-18', 'Geboren am 17. Januar 1940 in Ungarn, freie Publizistin, zwei Kinder. Mitglied im Ausschu√ü f√ºr Arbeit und Wirtschaft, Sozialausschu√ü, Kulturausschu√ü, Schulausschu√ü, Sportausschu√ü. Mitglied der Stadtratskommission zur Gleichstellung der Frauen. Besondere Anliegen: F√∂rderung des Mittelstandes, b√ºrgerfreundliche Verwaltung, F√∂derung des Jugendsports, Gleichstellung von Frauen in allen Lebensbereichen. ', '', 'Roth, Brigitta', NULL, NULL, NULL),
(69, '1996-03-10', 'Geboren am 27.3.1961 in Bruchsal. Lebt in eingetragener schwuler Lebensgemeinschaft. Studium der katholischen Theologie, Germanistik, Philosophie in Heidelberg. Seit 1982 in M√ºnchen. 1989/90 erstes Staatsexamen. Durch Entzug der kirchlichen Lehrerlaubnis Ausbildungsverbot. Aufbaustudium in Literaturkritik. Seit 1991 Gesch√§ftsf√ºhrer der M√ºnchner Aids-Hilfe e.V. 1990 bis 1996 im \nBezirksausschuss. Seit 1996 erster offen schwuler Stadtrat einer schwul-lesbischen W√§hlerInnen-Initiative in Europa.\n\nPolitische Schwerpunkte:\n- Gleichstellungspolitik f√ºr Lesben, Schwule und Transgender,\n- zielgruppenspezifische Gesundheitspr√§vention,\n- F√∂rderung kultureller Vielfalt, vor allem er Tanz-, Musik u. Literaturszene.\n\nMitglied im Kultur-, Gesundheits- und Kommunalausschuss, im Aufsichtsrat des Deutschen Theaters, im Beirat der M√ºnchner Philharmoniker.', 'http://www.thomasniederbuehl.de/', 'Niederb√ºhl, Thomas', NULL, NULL, 'http://www.abgeordnetenwatch.de/thomas_niederbuehl-860-47196.html'),
(70, '1996-03-10', 'In M√ºnchen am 31. Juli 1947 geboren, verheiratet, drei Kinder, Rechtsanwalt. Ehrenamtlicher Stadtrat von 1972 bis 1987 und seit 1996. ', '', 'Brunner , Manfred', NULL, NULL, NULL),
(71, '1990-03-18', 'Geboren am 12. Juli 1934 in M√ºnchen. Hochschulreife √ºber den zweiten Bildungsweg. Studium der Wirtschafts- und Politikwissenschaften in M√ºnchen und Berlin.Langj√§hrige berufliche T√§tigkeit in Wirtschaft und Verwaltung sowie als Journalist. Mehrj√§hrige Lehrt√§tigkeit an der Universit√§t M√ºnchen und an der Hochschule f√ºr Politik in M√ºnchen. Seit 1990 im Stadtrat.Besondere Schwerpunkte in der Rathausarbeit sind Haushalt und Finanzen, Personal- und Wirtschaftsfragen sowie B√ºrgerkontakte jeglicher Art. ', '', 'Dr. Echtler, Ulrich', NULL, NULL, NULL),
(72, '1990-03-18', 'Geb. am 19. Juli 1950 in Hofgeismar. Abitur an der Albert-Schweitzer (Unesco-)Schule. Studium Jura, Politik und Psychologie. Seit 1971 in M√ºnchen, Rechtsanwalt, Journalist. Gr√ºndete 1986 die Umwelt- und B√ºrgerorganisation David gegen Goliath. Seit 1990 Stadtrat.Anliegen: Ich stehe f√ºr eine wertorientierte Politik der praktischen Vernunft und m√∂chte gem√§√ü dem DaCG-Motto  Wunder heute m√∂glich machen  M√ºnchen zu einer kinder- und umweltfreundl. Solarstadt ohne Atom, mit autofreier Innenstadt, beispielhaftem B√ºrgerengagement und lebendiger Toleranz machen. ', '', 'Fricke, Bernhard', NULL, NULL, NULL),
(73, '1994-06-12', 'Geboren 26.1.1961 in Ludwigshafen/Rhein. Seit 1984 in M√ºnchen. Studium der BWL mit Schwerpunkten Marketing, Design und strategische Planung. Seit 1991 freiberuflich als Licht-Designer t√§tig. Seit 1994 im Stadtrat. Mitglied im Werk-, Stadtentw√§sserungs-, Bau-, Umweltschutz-, Kreisverwaltungs-, Sozialhilfe- und Kinder- und Jugendhilfeausschu√ü. Ziele im Rathaus: Individualit√§t, Freiheit und Mobilit√§t des B√ºrgers wahren. Verteidigung der Gewerbefreiheit gegen politische Bevormundung und √ºberh√∂hte Steuern. Leitsatz: So wenig Staat wie m√∂glich, so viel Staat wie n√∂tig. ', '', 'Hanna, Thomas', NULL, NULL, NULL),
(74, '1994-06-12', '&nbsp;', '', 'Thanheiser, Sven', NULL, NULL, NULL),
(75, '1994-06-12', 'Geboren am 31. Januar 1939 in Amorbach. Verheiratet, ein Sohn. Abitur 1958, Studium: Germanistik, Philosophie, Anglistik, 1. u. 2. Staatsexamen, Magister Artium. Lehrerin f√ºr Deutsch und Englisch bis 1976.\nMitglied bei M√ºtter gegen Atomkraft, amnesty international, Greenpeace, IPPNW, Bund Naturschutz, Global Challenges Network und Attac.\nIm Bundeshauptausschuss der √∂dp. \n\nZiele: Erhaltung der nat√ºrlichen Lebensgrundlagen, weltweite soziale Gerechtigkeit, mehr Demokratie.\n\nSchwerpunkte:\n¬ï Erneuerbare Energien,\n¬ï Kreislaufwirtschaft,\n¬ï √ñffentlicher Personennahverkehr,\n¬ï attraktives, kompaktes Bauen durch Terrassenreihenh√§user,\n¬ï Abbau der Verschuldung der Stadt.\n\nMitglied im Ausschuss f√ºr Arbeit- und Wirtschaft, im Kommunal-, Sozial- und Umweltschutzausschuss.', '', 'von Walter, Mechthild', NULL, NULL, NULL),
(76, '1993-09-17', 'Geboren am 21. M√§rz 1940 in M√ºnchen, verheiratet, drei erwachsene Kinder, drei Enkelkinder.\n\nAbitur am st√§dtischen Elsa-Br√§ndstr√∂m-Gymnasium in M√ºnchen-Pasing. Studium der Germanistik, Altphilologie und Geschichte in M√ºnchen und Wien. Abschluss mit der Promotion zum Dr. phil. an der Ludwig-Maximilians-Universit√§t M√ºnchen.\n\nVon 1967 bis 1990 neben der Hausfrauent√§tigkeit vor allem ehrenamtlich t√§tig (20 Jahre Bezirksausschuss, 14 Jahre Elternbeirat, 10 Jahre Adoptionsvermittlung f√ºr das Kinderhilfswerk Terre des hommes). \n\nVon 1990 bis September 1993 ehrenamtliche Stadtr√§tin, Korreferentin des Schulreferats, stellvertretende Vorsitzende der SPD-Stadtratsfraktion.\n\nAm 17. September 1993, am 29. Juni 1994 und erneut am 2. Mai 1996 und erneut am 2. Mai 2002 zur 2. B√ºrgermeisterin gew√§hlt, zust√§ndig f√ºr die Sozialaussch√ºsse, die Aussch√ºsse f√ºr Schule und Sport, den Kommunalausschuss, f√ºr B√ºrgerangelegenheiten und die Bezirksaussch√ºsse, Aufsichtsratsvorsitzende der M√ºnchner Tierpark\nHellabrunn AG und der M√úNCHENSTIFT GmbH.\n\nZielsetzung:\n"Trotz aller Sparzw√§nge werde ich mich mit aller Kraft daf√ºr einsetzen, den sozialen Frieden in unserer Stadt zu erhalten.\nDazu geh√∂rt auch, dass wir unserer Jugend gen√ºgend Bildungs- und Berufschancen anbieten k√∂nnen. Ich trete f√ºr ein kinder- und\nfamilienfreundliches Klima und ein Miteinander der Generationen in unserer Stadt ein. Vielf√§ltige Angebote f√ºr die √§ltere Generation sollen ihr die M√∂glichkeit eines selbstbestimmten w√ºrdigen Lebens im Alter er√∂ffnen.\n\nZudem mu√ü die Verwaltungsreform weiter vorangetrieben werden, damit unsere Stadt noch b√ºrgern√§her und in ihren Ma√ünahmen noch transparenter wird."\n\nBis 31.12.2005 2. B√ºrgermeisterin.', '', 'Dr. Burkert, Gertraud', NULL, NULL, NULL),
(77, '1978-03-05', 'Geboren am 1. Februar 1938 in Weilheim. Verheiratet, drei T√∂chter.\nSeit 1954 in M√ºnchen als Stadtpfarrmesner in der Pfarrei St Rupert auf der Schwanthalerh√∂he.\nSeit 1978 im Stadtrat.\nKommunalpolitische Ziele: Stadtteilsanierung mit Modernisierung und Neubau von familien- und altengerechten Wohnungen, bessere Versorgung √§lterer B√ºrger durch ambulante Dienste und Altenservicezentren. Erhaltung von Kleinbetrieben und qualifizierten Arbeitspl√§tzen. Versorgung mit Schulen; Verkehrsplanung. Erhaltung der M√ºnchner Innenstadt als Wohngebiet.', '', 'Ilg, Hugo', NULL, NULL, NULL),
(78, '1978-03-05', 'Geboren 1929 in M√ºnchen. Verheiratet, vier Kinder. Abitur, Schriftsetzer-Lehrmeister, werbefachl. Abendstudium.\nSeit 1978 e.a. Stadtrat. Mitglied der Aussch√ºsse f√ºr Wirtschaft, Stadtplanung und Riem. Wirtschaftspolitischer Sprecher der CSU-Fraktion.\nKommunalpolitische Ziele: F√∂rderung des mittelst√§ndischen Handels und Handwerks sowie einer guten Berufsausbildung - Bau und Erhaltung von preisg√ºnstigem Wohnraum - F√∂rderung eines sinnvollen Umweltschutzes.', '', 'Schottenheim, Albert', NULL, NULL, NULL),
(79, '1978-03-05', 'Geboren am 29. M√§rz 1921 in M√ºnchen. Verheiratet. 1948 Meisterpr√ºfung im Schlosserhandwerk, 1959 √úbernahme des v√§terlichen Stahl- und Metallbaubetriebs.\nEhrenobermeister der Metall-\nInnung M√ºnchen. Langj√§hriger Ortsbeauftragter des THW M√ºnchen.\n\nSeit 1972 Stadtrat.\n\nMitglied im Bau- und Kreisverwaltungsausschuss.\n\nSchwerpunkte meiner Stadtratsarbeit:\n&#8226;	Erhaltung der M√ºnchner Wirtschaftskraft,\n&#8226;	Stadtviertelarbeit,\n&#8226;	Hilfe f√ºr sozial Schwache,\n&#8226;	F√∂rderung der Rettungsdienste.\n&#8226;	Oberstes Ziel: &#8222;Die sozial Schw√§cheren bed√ºrfen der Hilfe des wirtschaftlich St√§rkeren.&#8221;\n', '', 'Hierl, Rudolf', NULL, NULL, NULL),
(80, '1990-03-18', 'Stadtrat seit 1990. Geboren am 23. April 1932 in M√ºnchen, r. k., verheiratet, zwei T√∂chter, selbst. Dipl.lng.(FH); technische Geb√§udeausr√ºstung; stellvertr. Bezirksvorsitzender der AGM-Arbeitsgemeinschaft Mittelstand der CSU-M√ºnchen; Sprecher der CSU im Riemausschu√ü, Mitglied im Bauausschu√ü, Werkausschu√ü und Stadtplanungsausschu√ü, Energiekommission.\nSchwerpunkte: Mittelstandsf√∂rderung, Erhalt der M√ºnchner Wirtschaftskraft, Wohnungsbau, Energieversorgung, F√∂rderung kultureller Belange.', '', 'Winklmaier, Friedrich', NULL, NULL, NULL),
(216, '2002-03-03', 'Geb. 16.09.1963 in Samsun/T√ºrkei, seit 1970 in Deutschland, verheiratet.\n1993 Abschlu√ü des Studiengangs Verwaltungswissenschaften an der Uni Konstanz,\n1983-1996 Sozialberaterin f√ºr MigrantInnen bei der AWO M√ºnchen,\n1996-2002 sozial- und migrationspolitische Referentin der Stadtratsfraktion B√ºndinis 90/Die Gr√ºnen, zudem seit 1997 als Interkulturelle Familienberaterin t√§tig.\n\nBesondere Anliegen:\n¬ï	Multikulturelle Stadtgesellschaft auf allen Ebenen\n¬ï	verbesserte Bildungschancen f√ºr junge MigrantInnen\n¬ï	menschenw√ºrdiges Leben f√ºr ausl√§ndische Senioren\n¬ï	ausreichend Wohnraum f√ºr sozial Schwache\n¬ï	kulturelle Vielfalt in der Jugendarbeit\n\nMitglied im Sozial-, Bau-, Kinder- und Jugendhilfe- und Kommunalausschuss.\n', '', '√ñzakin, Sedef', NULL, NULL, NULL);
