(1418539, '2008-03-02', 'Geboren am 20.4.1964 in M√ºnchen, verheiratet, zwei Kinder, √Ñrztin.\nFraktionssprecherin im BA Pasing - Obermenzing, im Stadtrat seit 2008.\n\nMitglied im Bau-, Kultur- und Sozialausschuss, stv. sozialpolitische und seniorenpolitische Sprecherin.\n\nMeine Ziele:\n- Ausbau der Kinderbetreuung und der Ganztagsschulen zur besseren Vereinbarkeit von Familie und Beruf\n- Seniorengerechte Angebote und Wohnungen f√ºr ein selbstbestimmtes Leben in W√ºrde\n- Erhalt der St√§dtischen Kliniken in kommunaler Hand mit Spitzenmedizin f√ºr alle\n- Vielfalt in der Kulturlandschaft \n- Ausbau des Radwegenetzes, sichere Radwegef√ºhrung, mehr moderne Fahrradabstellanlagen\n- Ausbau des √ñPNV', '', 'Dr. S√∂llner-Schaar, Constanze', NULL, NULL, 'http://www.abgeordnetenwatch.de/dr_constanze_soellner_schaar-860-47225.html'),
(1418542, '2008-03-02', 'Geboren 1960 in Koblenz, seit 1985 in M√ºnchen, drei Kinder, Bankkauffrau.\n\nSeit 2008 im Stadtrat.\nBildungspolitische Sprecherin.\n\nMitglied im Bildungs-, Sport-, Kinder- und Jugendhilfe- und Bauausschuss \n\nSchwerpunkte:\n- Bildungsgerechtigkeit\n- Erhalt des kommunalen Schulwesens\n- F√∂rderung des Breitensports und Aufwertung der ehrenamtlichen Arbeit in Vereinen\n- Optimierung des Sportst√§ttenmanagements; Erhalt und Sanierung bestehender Sportanlagen.', '', 'Volk, Birgit', NULL, NULL, 'http://www.abgeordnetenwatch.de/birgit_volk-860-47229.html'),
(1418545, '2008-03-02', 'Geboren am 23.9.1963, aufgewachsen in Wemding/Bay., seit 1983 in M√ºnchen, Vater von drei Kindern.\nGeographiestudium an der TU M√ºnchen, seit 1991 t√§tig als Stadt- und Verkehrsplaner, seit 1998 selbstst√§ndig, zus√§tzlich Radreiseautor.\n\n1994 ? 96 und seit 1999 Mitglied im Bezirksausschuss Ludwigsvorstadt-Isarvorstadt, seit 2008 im Stadtrat, in den Aussch√ºssen f√ºr Stadtplanung und Bauordnung, f√ºr Arbeit und Wirtschaft sowie im Bauausschuss und im Aufsichtsrat der MVG.\n\nKommunalpolitische Ziele\n- Urbane, gr√ºne und familienfreundliche Stadtviertel mit lebendiger Mischung, kurzen Wegen und attraktiven √∂ffentlichen R√§umen\n- Stadt- und klimavertr√§gliche Mobilit√§t mit besonderem Schwerpunkt beim Fu√ü- und Radverkehr.', 'http://www.paul-bickelbacher.de/', 'Bickelbacher, Paul', NULL, NULL, 'http://www.abgeordnetenwatch.de/paul_bickelbacher-860-47150.html'),
(1418548, '2008-03-02', 'Geboren am 10.9.1964 in Malatya, T√ºrkei, eine erwachsene Tochter, Dipl.-Sozialp√§dagogin bei der Arbeiterwohlfahrt.\n\nFraktionsvorsitzende.\n\nStadtr√§tin seit 2008, Mitglied im Sozial-, Kommunal- und Kinder- und Jugendhilfeausschuss sowie in der Gleichstellungskommission.\n\nSchwerpunkte:\n- Sozialpolitik\n- Kinder- und Jugendpolitik\n- Migrationspolitik\n- Wohnen.', '', 'Demirel, G√ºlseren', NULL, NULL, 'http://www.abgeordnetenwatch.de/guelseren_demirel-860-47155.html'),
(1418551, '2008-03-02', 'Geb. am 22.11.1963 in Stuttgart, zwei Kinder, seit 1983 in M√ºnchen. Studium der Geographie, Stadt- und Verkehrsplanung an der TU M√ºnchen. T√§tigkeit in verschiedenen Planungs- und Ingenieurb√ºros, im Planungsreferat und bei der MVG. Seit 2008 im Stadtrat.\nMitglied im Umwelt-, Planungs- und Kulturausschuss, im Hauptausschuss des Deutschen St√§dtetages und im Wirtschafts- und Verkehrsausschusses des Bayerischen St√§dtetages sowie im Aufsichtsrat der Messe M√ºnchen GmbH, der GEWOFAG und der Gasteig M√ºnchen GmbH.\n\nSchwerpunkte:\n- Nachhaltige Stadtentwicklung (sozial, √∂kologisch, familienfreundlich) \n- √ñkologische Verkehrsplanung (√ñffentlicher Verkehr, Fu√ü- und Radverkehr)\n- Neue Energiekonzepte (Erneuerbare Energien, Energieeffizienz)\n- Integrierende Stadtgesellschaft (multikulturell, solidarisch).', 'http://www.sabine-nallinger.de/', 'Nallinger, Sabine', NULL, 'sabine.nallinger', 'http://www.abgeordnetenwatch.de/sabine_nallinger-860-47157.html'),
(1418554, '2008-03-02', 'Geboren 1967 in Hermannstadt/Sibiu (Rum√§nien), Philosoph (M.A.) und Politologe (Promotion), Bildungsberater (Referat f√ºr Bildung und Sport), Philosophiedozent an der M√ºnchner Volkshochschule.\n2001 - 2007 Vorsitzender der M√ºnchner Gr√ºnen.\nFraktionsvorsitzender, Mitglied im Kultur-, Verwaltungs- und Personal- und Finanzausschuss sowie im √Ñltestenrat. Aufsichtsrat der M√ºnchner Volkshochschule und des M√ºnchner Volkstheaters.\n\nPolitische Ziele:\n- Chancengerechtigkeit und Innovation in der Bildung.\n- Integration von Migrantinnen und Migranten.\n- Vielfalt in der Kultur, F√∂rderung der freien Szene.\n- St√§rkung der B√ºrgerbeteiligung. \n- b√ºrgerfreundliche Verwaltung.\n', 'http://www.florian-roth.com/', 'Dr. Roth, Florian', 'roth_florian', 'drflorianroth', 'http://www.abgeordnetenwatch.de/dr_florian_roth-860-47154.html'),
