(1418560, '2008-03-02', 'Geboren am 6.10.1953 in Mainz, verpartnert seit 2006. Studium der Wirtschaftsu. Politikwissenschaften. Seit 1982 in verschiedenen Unternehmen t√§tig, meist in der Gesch√§ftsleitung, seit 2003 selbst√§ndiger Unternehmensberater. Seit 1972 Mitglied der FDP; 1979-1984 Stadtrat in Mainz. 1988-1994 Vorsitzender FDP M√ºnchen, 1991-1997 stv. Landesvorsitzender in Bayern und 2008-2014 Fraktionsvorsitzender der FDP im M√ºnchner Stadtrat. Seit 2014 Fraktionsvorsitzender der Fraktion Freiheitsrechte, Transparenz, B√ºrgerbeteiligung.\nMitglied: √Ñltestenrat, Stadtplanung und Bauordnungs-, Finanz- sowie Rechnungspr√ºfungsausschuss. \n\nSchwerpunkte:\n- Investitionsstau bei Schulen und Verkehr aufl√∂sen,\n- Wohnungsbau verst√§rken\n- Freiheitliche L√∂sungen statt G√§ngelei und Bevormundung\n- Stadtwerke nicht als Global Player', 'http://www.michaelmattar.de/', 'Dr. Mattar, Michael', 'DrMichaelMattar', 'DrMichaelMattar', 'http://www.abgeordnetenwatch.de/dr_michael_mattar-860-47192.html'),
