(1418572, '2008-03-02', 'Geboren 1959 in Stuttgart, seit 1979 in M√ºnchen lebend; ledig.\nStudium der Rechts- und Politikwissenschaft sowie der Erwachsenenp√§dagogik.\nAktuell als Professor f√ºr ¬ìEuropean Studies¬î an der Hochschule M√ºnchen t√§tig.\nSeit Mai 2008 im Stadtrat.\n\nBesondere Anliegen und Ziele:\n¬ï Bessere Verkehrsinfrastruktur,\n¬ï bezahlbarer Wohnraum,\n¬ï fl√§chendeckende Kinderbetreuungsangebote,\n¬ï Unterst√ºtzung ehrenamtlicher T√§tigkeit,\n¬ï B√ºrgern√§he in Politik und Verwaltung.\n\nAussch√ºsse:\nBauausschuss, Finanzausschuss, Kulturausschuss sowie Ausschuss f√ºr Stadtplanung und Bauordnung.', '', 'Prof. Dr. Piazolo, Michael', NULL, NULL, NULL),
(1418575, '2008-03-02', 'Geb. 12.03.1982 in Pasing.\nSelbst√§ndiger Programmierer und Examenskandidat (Jura).\nMitglied im Kreisverwaltungs-, Gesundheits-, Personal- und Sport-/Schulausschuss.\n\nIch bin ein √ºberzeugter Verfechter der kommunalen Selbstverwaltung und ein Gegner jeden Zentralismus¬í - sei es auf europ√§ischer, bundesdeutscher oder bayerischer Ebene.\nGerade das hat mich bewogen, f√ºr den Stadtrat zu kandidieren.\nZu meinen Anliegen geh√∂rt es, dass M√ºnchen die liebenswerte Stadt bleibt, die jedes Jahr Millionen Touristen und tausende Neub√ºrger anzieht. Trotz aller Weltoffenheit und Toleranz d√ºrfen wir dabei aber unsere eigene Identit√§t nicht noch weiter verlieren.\nM√ºnchen ist eine Weltstadt mit Herz - und dieses Herz muss wei√ü-blau bleiben!', '', 'Hummel, Thomas', NULL, NULL, NULL),
(1418578, '2008-03-02', 'Geboren 1962 in M√ºnchen, r√∂m.- kath., Abitur am Luitpold-Gymnasium, nach dem Wehrdienst Studium in den F√§chern Geschichte, Musikwissenschaft, Sanskrit und Volkskunde an der LMU. 1989 ? 94 Parlamentarischer Referent am Europ√§ischen Parlament. 2001 Wiedereintritt in die Bundeswehr, dort u.a. Aufgaben im Bereich der politischen Bildung.\nSeit 2009 stellvertretender NPDParteivorsitzender.\nStadtrat in M√ºnchen seit 2008.\nAutor mehrerer B√ºcher.\n\nKommunalpolitische Ziele:\n- Kein Islamzentrum in M√ºnchen!\n- Wohnungen bevorzugt f√ºr Einheimische statt f√ºr "Migrationshintergr√ºndler"!\n- Schlu√ü mit der st√§dtischen F√∂rderung linksextremer Szenetreffs!\n- M√ºnchner Schulen sanieren statt Schwulenf√∂rderung!', '', 'Richter, Karl', NULL, NULL, 'http://www.abgeordnetenwatch.de/karl_richter-860-47162.html'),
