(3312640, NULL, 'Geboren am 19. Mai 1958 in Rain am Lech (Kreis Donau-Ries), Umzug bereits 1960 nach M√ºnchen. Verheiratet mit Petra Reiter, drei erwachsene Kinder.\n\nIn Sendling aufgewachsen und zur Schule gegangen. 1981 Abschluss als Diplomverwaltungswirt an der Fachhochschule f√ºr √ñffentliche Verwaltung und Rechtspflege in Bayern. Von 1981 bis 2009 in der Stadtk√§mmerei t√§tig, u.a. als B√ºroleiter und Pressesprecher, Amtsleiter des Kassen- und Steueramts sowie als Stellvertretender Stadtk√§mmerer der LH M√ºnchen.\nVon 2009 bis 2014 berufsm√§√üiger Stadtrat als Referent f√ºr Arbeit und Wirtschaft.\n\nSeit 1. Mai 2014 Oberb√ºrgermeister der Landeshauptstadt M√ºnchen. Leitung der Aussch√ºsse f√ºr Stadtplanung und Bauordnung, Arbeit und Wirtschaft, Verwaltung und Personal, des Finanzausschusses sowie der Stadtgestaltungskommission.\n\nAufsichtsratsvorsitzender der Stadtwerke M√ºnchen (SWM), der M√ºnchner Verkehrsgesellschaft (MVG), der st√§dtischen Wohnungsbaugesellschaften GWG und Gewofag sowie der St√§dtisches Klinikum M√ºnchen GmbH (StKM). Vertritt die Stadt im Aufsichtsrat der Flughafen M√ºnchen GmbH (FMG) und der Messe M√ºnchen GmbH (MMG). Vorsitzender der Gremien des MVV und des Verwaltungsrats der Stadtsparkasse M√ºnchen.\n\nMitglied der Gewerkschaft ver.di, der Arbeiterwohlfahrt M√ºnchen (AWO), des Mietervereins M√ºnchen e.V., sowie ehrenamtliches Mitglied der Georg-von-Vollmar-Akademie e.V., Mitglied im Kuratorium des Deutschen Museums, im Ifo-Institut M√ºnchen und bei der Freiwilligen Feuerwehr.\n\nZielsetzung: "M√ºnchen muss eine Stadt f√ºr alle bleiben. Nur so werden wir dieses einmalige M√ºnchner Lebensgef√ºhl bewahren, nur so wird M√ºnchen auch in Zukunft eine weltoffene, tolerante, soziale und gleichzeitig wirtschaftlich erfolgreiche Stadt sein."', '', 'Reiter, Dieter', NULL, 'OB2014', NULL),
